import React from 'react';
import ReactDom from 'react-dom';





const SearchPanel = () => {
    return <input placeholder="search"/>
}

const App = () => {
    const loginBox = <span> Log in please</span>
    return (
        <div>
            {loginBox}
            <AppHeader/>
            < SearchPanel/>
            <TodoList/>
        </div>
    )
}

ReactDom.render(
    <App/>, document.getElementById('root'));
